import React from 'react';
import { 
  LineChart, 
  Line,
  ResponsiveContainer
} from 'recharts';

const MyLineChart = () => {
  const data = [
    { name: 'Engagement', engagement_level: 1 },
    { name: 'Engagement', engagement_level: 1 },
    { name: 'Engagement', engagement_level: 0 },
  ];

  return (
    <ResponsiveContainer width="100%" height="100%">
      <LineChart
        data={data}
      >
        <Line type="monotone" dataKey="engagement_level" stroke="#8884d8" />
      </LineChart>
    </ResponsiveContainer>
  );
};

export default MyLineChart;
